import SearchIcon from "@mui/icons-material/Search";
import CloseIcon from "@mui/icons-material/Close";

import axios from "axios";

import { TextField, InputAdornment, IconButton } from "@mui/material";
import { useEffect, useState } from "react";

export default function Browser(data, setData) {

  const [search, setSearch] = useState('');
  const [icon, setIcon] = useState(false);

  const handleClear = () => {
    setSearch(''); 
  }

  useEffect(() => {
    search.length > 0 ? setIcon(true) : setIcon(false);
    const res = data.data.find(e => e.name.first.toLowerCase().includes(search.toLowerCase()))
    console.log("Res", res)
  }, [search]);

  return (
    <div className="App">
      <TextField
        id="text"
        label="Buscar"
        value={search}
        variant="outlined"
        onChange={({ target }) => setSearch(target.value)}
        InputProps={{
          endAdornment: (
            <IconButton
                edge="start"
                onClick={handleClear}
            >
                {!icon ? <SearchIcon /> : <CloseIcon />}
            </IconButton>
          ),
        }}
      />
    </div>
  );
}
